import React, { Component } from 'react';
import './App.css';
import './Filmography.css';
import App from './App';

class Filmography extends Component {
  constructor(props){
    super(props);

  }
  render() {
    //generating local css classes object...
    var localCSSclasses = {
      inkstainBackground: 'inkstainmiddle'
    }
    let {EmilyInfo} = this.props;
    var sectionTitle = 'Filmography';
    var sectionDefinition = 'A collection of works, films and screenings ft. Emily Bandel';
    
    return (
      <div className={localCSSclasses.inkstainBackground}>
      </div>
      
    );
  }
}

export default Filmography;
